import React from 'react';
import { View, Text } from 'react-native';

const YoutubeReports = () => {
    return (
        <View>
            <Text>YouTube Reports</Text>
            {/* Your YouTube Reports content */}
        </View>
    );
};

export default YoutubeReports;
